import React from 'react';

const GameOptions = ({ onRoll, onHold, isGameOver }) => {
    return (
        <div className="controls">
            <button onClick={onRoll} disabled={isGameOver}>Roll Dice</button>
            <button onClick={onHold} disabled={isGameOver}>Hold</button>
        </div>
    );
};

export default GameOptions;
